let tomadoroTime = 0;
let tomato = 0;
let breakTime = 0;
let flag = 0;

function TomadoroTimer() {
    if (tomadoroTime > 0) {
        tomadoroTime--;
        //console.log(tomadoroTime);
        printTime();
    }
    if (tomadoroTime == 0) {
        //console.log("==0");

        //console.log("before beep");
        //beep 9 times and reset the timer to breakTime automatically
        beep();
        //console.log("beeped");
        if (flag == 0) {
            tomadoroTime = breakTime;
            //console.log(tomadoroTime);
            flag = 1;
        } else {
            tomadoroTime = tomato;
            //console.log(tomadoroTime);
            flag = 0;
        }

    }
}

function printTime(){
    var ti = tomadoroTime;
    var hours = parseInt(ti/3600);
    //console.log("hours:")
    //console.log(hours);

    ti %= 3600;
    var minutes = parseInt(ti/60);
    ti %= 60;
    var seconds = ti;
    var timeString = ('0' + hours).slice(-2) + ':' +('0' + minutes).slice(-2) + ':' + ('0' + seconds).slice(-2);
    document.querySelector('#timer').innerHTML = timeString;
}

function init_TomadoroTimer() {
    //console.log("initTomadoro")
    setInterval(TomadoroTimer, 1000);

}


document.addEventListener('DOMContentLoaded', () => {
    document.querySelector('#go').onclick = () => {
        const t = document.querySelector('#tomadoroTime').value;
        tomato = parseInt(t)*60;
        tomadoroTime = tomato;
        flag = 0;
        breakTime = 60*parseInt(document.querySelector('#breakTime').value);
        //console.log(tomadoroTime);
        //document.querySelector('#tomadoroTime').value = '';
        if (tomadoroTime > 0) {
            init_TomadoroTimer();
        }
        // return init_TomadoroTimer; // stop form submiting
    }

});


function beep() {
    var snd = new Audio("data:audio/mpeg;base64,");

    snd.play();
    
}